import React from 'react';

const About = () => {
  return (
    <section id="about" className="section about">
      <h1>About Bhavesh Chainani</h1>
      <p>
        Detail-oriented and results-driven Data Scientist with 4+ years of professional experience...
      </p>
    </section>
  );
}

export default About;
